criteria:
Inclusion Criteria:

  -  Male or female subjects with age ≥ 18 years or the otherwise legal lower age according
     to the country of residence;

  -  Confirmed acute lower extremity proximal DVT or PE for which long term treatment with
     low molecular weight heparin (LMWH) is indicated;

  -  Cancer, other than basal-cell or squamous-cell carcinoma of the skin;

  -  Able to provide written informed consent.

Exclusion Criteria:

  -  Thrombectomy, insertion of a caval filter, or use of a fibrinolytic agent to treat the
     current (index) episode of DVT and/or PE;

  -  Treatment with therapeutic doses of an anticoagulant other than that used for
     pretreatment of the current (index) VTE episode prior to randomization;

  -  Active bleeding or high risk for bleeding contraindicating treatment with LMWH or
     edoxaban;

  -  Any other contraindication listed in the local labeling of dalteparin, enoxaparin, or
     edoxaban;

Inclusion Criteria:

  -  Affiliated to a social security regimen ;

  -  Male patients older than 18 years ;

  -  Histologically confirmed adenocarcinoma of the prostate ;

  -  Continued androgen deprivation therapy either by LHRH agonists/antagonists or
     orchidectomy ;

  -  Serum testosterone <0.50 ng/ml (1.7 nmol/L) ;

  -  Progressive disease (PSA progression or radiological progression or clinical
     progression) ;

  -  ECOG 0-2 ;

  -  Information delivered to patient and informed consent form signed by the patient or
     his legal representative ;

  -  Adequate organ or bone marrow function as evidenced by:

       -  Hemoglobin >/= 10 g/dL

       -  Absolute neutrophil count >/=1.5 x 109/L,

       -  Platelet count >/=100 x 109/L,

       -  AST/SGOT and/or ALT/SGPT </=1.5 x ULN;

       -  Total bilirubin </=1.5 x ULN,

       -  Serum creatinine </=1.5 x ULN. If creatinine 1.0 - 1.5 xULN, creatinine clearance
          will be calculated according to CKD-EPI formula and patients with creatinine
          clearance <60 mL/min should be excluded

Exclusion Criteria:

  -  Patients having received an investigational drug and/or prior surgery, radiation,
     chemotherapy, or other anti-cancer therapy within 4 weeks prior enrolment in the
     study, excepted radiotherapy directed to a single bone lesions which is nonacceptable
     if within 2 weeks ;

  -  Prior treatment with Taxotere or Jevtana ;

  -  Pre-existing symptomatic peripheral neuropathy grade > 2 (CTCAE V4) ;

  -  Uncontrolled cardiac arrhythmias, angina pectoris, and/or hypertension. History of
     congestive heart failure (NYHA III or IV) or myocardial infarction within last 6
     months is also not allowed ;

  -  History of severe hypersensitivity reaction (grade ≥3) to polysorbate 80 containing
     drugs ;

  -  Uncontrolled severe illness or medical condition (including uncontrolled diabetes
     mellitus), active infection including HIV infection, active Hepatitis B or C infection
     that would preclude participation in the trial ;

  -  Concurrent or planned treatment with strong inhibitors or strong inducers of
     cytochrome P450 3A4/5 (a one week wash-out period is necessary for patients who are
     already on these treatments) ;

Inclusion Criteria:

  1. 18 ~ 75 years old, postmenopausal women;

  2. Histological or cytological confirmation of hormone receptor-positive [estrogen
     receptor (ER) positive and progesterone receptors (PgR) positive or negative] breast
     cancer;

  3. Disease progression or recurrence after at least one endocrine therapy (either in
     advanced/metastatic setting or adjuvant setting);

  4. ≤4 prior therapies (either in advanced/metastatic setting or adjuvant setting),
     patients may have received one prior chemotherapy;

  5. The disease condition is inoperable, stage III or stage IV, at least one measurable
     lesion or simple bone metastases with no measurable lesions;

  6. Last prior therapy intervals: (a) if the last treatment was endocrine therapy, the
     interval must ≥ 2 weeks; (b) if the last treatment was chemotherapy therapy, the
     interval must ≥ 4 weeks;

  7. Eastern Cooperative Oncology Group Performance Status: 0~1;

  8. Absolute neutrophil count ≥ 1.5×109 / L, platelet count ≥ 100×109 / L, hemoglobin ≥ 90
     g/L;

  9. Life expectancy ≥ 3 months;

 10. Have signed informed consent.

Exclusion Criteria:

  1. Patients have known central nervous system (CNS) metastases or a history of CNS
     metastases , or with leptomeningeal disease;

  2. Patients with human epidermal growth factor receptor-2 (Her-2) positive;

  3. Patients previously received treatment with exemestane;

  4. Patients received radiotherapy ≤ 4 weeks prior to study entry;

  5. Patients with no measurable lesion (except simple bone metastasis), such as pleural or
     pericardial effusion, ascites, et al;

  6. Patients have uncontrolled or significant cardiovascular disease, including:

       1. Myocardial infarction (< the last 12 months)

       2. Uncontrolled angina (< the last 6 months)

       3. Congestive heart failure (< the last 6 months), or Left Ventricular Ejection
          Fraction (LVEF) < 50% prior to study entry

       4. History of any significant ventricular arrhythmias (e.g., ventricular
          tachycardia, ventricular fibrillation, or TdP)

       5. History of significant QT interval prolongation, or Corrected QT Interval (QTc) >
          450 ms prior to study entry

       6. History of cerebrovascular accident

       7. Symptomatic coronary heart disease requiring treatment with agents

  7. The size of fluid area detected by cardiac ultrasonography in cavum pericardium is
     ≥10mm during diastolic period;

  8. History of organ transplantation;

  9. Patients have not recovered from all clinically relevant toxicities to grade 1 due to
     prior therapies;

 10. Patients have clinical significant gastrointestinal abnormality, e.g., unable to
     swallow, chronic diarrhea, ileus, that would interfere the ingestion,transportation or
     absorption of oral agents;

 11. Active infection [Suffered from active infection of bacteria, virus, fungi,
     mycobacteria, parasites, or other infections (excluding nail bed fungal infections),
     or require intravenous antibiotic therapy, or antiviral therapy, or hospitalization
     due to any significant infection events], or persistent fever within 14 days prior to
     study entry;

 12. Patients had organ surgery < 6 weeks prior to study entry;

 13. Abnormal liver function [total bilirubin > 1.5×upper limit of normal (> 3×upper limit
     of normal in case of Gilbert syndrome); Transaminases (ALT, AST) >2.5×upper limit of
     normal (>5x upper limit of normal patients with liver metastases), abnormal renal
     function (serum creatinine > 1.5×upper limit of normal);

 14. Patients with prior invasive malignancies with the exception of curatively-treated
     basal cell or squamous cell carcinoma of the skin or cervical carcinoma in situ,
     unless received curative treatment and with documented evidence of no recurrence in
     the past five years;

 15. Any mental or cognitive disorder, that would interfere the ability to understand the
     informed consent document or the operation and compliance of study;

 16. Patients are currently enrolled in another investigational drug study, or completed
     within 4 weeks prior to study entry, with the exception of patients only in overall
     survival follow-up;

 17. Any other condition which is inappropriate for the study in the opinion of the
     investigators.

Inclusion Criteria:

  1. Histologically and/or cytologically diagnosed patients with advanced, metastatic
     breast cancer,or lacking standard therapy or being failed to or recurrent after
     standard therapy;

  2. Patients who have previously treated with ≤4 chemotherapeutic regimes;

  3. Patients who have previously treated with an anthracyclin antibiotics and a taxane;

  4. Age 18 -70 years old, ECOG performance status of 0-2; Life expectancy of 3 months or
     more;

  5. Patients with at least 1 measurable target lesion determined by CT within 2 weeks
     prior to enrollment;

  6. Neuropathy <CTC2 degree （NCI CTC4.03）within 4 weeks prior to enrollment;

  7. Basically normal results from routine blood test within 1 week prior to enrollment;

  8. Basically normal liver and renal functions within 1 week prior to enrollment;

  9. No abnormal function for major internal organs, no heart diseases.

Exclusion Criteria:

  1. Received chemotherapy, radiotherapy, therapies with hormones or molecularly targeted
     drugs 4 weeks prior to enrollment, or received other chemotherapies while
     participating in this trial;

  2. Patients with documented hypersensitivity to Cremophor EL, or patients with previous
     taxane treatment related SAE;

  3. Patients of pregnancy or breast feeding;

  4. Patients with previous standard capecitabine treatment ineffective, or patients
     received standard capecitabine treatment effective, but with less than 6 months of
     capecitabine clearance period;

  5. Patients with uncontrolled brain metastasis or bone metastasis, which plan for recent
     surgery or local radiotherapy, or other emergency treatment;

  6. Patients combined with severe and /or uncontrolled medical conditions, including
     severe cardiovascular disease, uncontrolled diabetes and high blood pressure, severe
     infection, severe gastrointestinal ulceration, and patients with incontrollable
     psychiatric history;

  7. Patients with poor compliance;

  8. Patients not fitted for this study determined by the investigators.
